import React from 'react'
import { Lock, Person } from '@mui/icons-material';
import { Link } from 'react-router-dom';
import './login.css'
function Login() {
    const sendEmail = (e) => {
        e.preventDefault();
    };
  return (
    <div className='loginTop '>
            <form action='' className='loginForm'  onSubmit={sendEmail}>
                <h1>Login</h1>
                <div className='inputBox'>
                    <input type='text' placeholder='Nom d’utilisateur' required />
                    <Person className='iconLogin' />
                </div>
                <div className='inputBox'>
                    <input type='password' placeholder='Mot de passe' required />
                    <Lock className='iconLogin' />
                </div>
                <div className="rememberForgot">
                <label className='labelLogin'><input type="checkbox" />Rappelle-moi</label>
                    <Link to={'/forgotPass'}>Mot de passe oublié?</Link>
                </div>
                <button type='submit'>Login</button>
                <div className='registerLink'>
                    <p> Vous n’avez pas de compte? <Link to={'/register'}>Register</Link></p>
                </div>
            </form>

        </div>
  )
}

export default Login
